description:
Learn five Slash tracks note for note, guitar lessons by Danny Gill

This superb DVD will teach you five tracks from this rock guitar legend... learn every guitar riff and solo note for note! Lessons include;

Nothing To Say
By The Sword
Ghost
Beautiful Dangerous
Watch This

Danny Gill is a former pupil of Joe Satriani, and co-author of the Musicians Institute Rock Lead Guitar series. His songs have appeared on numerous TV shows including 'The Osbournes' as well as motion picture soundtracks such as 'Insomnia' and 'Under Siege'.

